import React from "react";
import "./home4.scss";

export default function Home4() {
  return (
    <div className="home4">
      <div className="h4-image">
        <img src="/images/mobile11.png" alt="" />
      </div>
      <div className="h4-texts">
        <h3 className="lato-regular">Natychmiastowa pomoc</h3>
      </div>
    </div>
  );
}
